import CheckBoxFilterBlock from "./CheckBoxFilterBlock";
import FilterLine from "./FilterLine";
import "./Filters.css";

function Filters() {
  return (
    <div className="filtersContainer">
      Фильтры
      <CheckBoxFilterBlock name="Размеры">
        <ul>
          {checkBoxFilterData.map((item) => (
            <li key={item.key}>
              {console.log(JSON.stringify(item))}
              {item.text}
            </li>
          ))}
        </ul>
      </CheckBoxFilterBlock>
      <ul>
        <li>1</li>
      </ul>
    </div>
  );
}

const checkBoxFilterData = [
  { key: 0, text: "S" },
  { key: 1, text: "M" },
  { key: 2, text: "X" },
  { key: 3, text: "XS" },
];

export default Filters;
